insert  into `tb_website_apply_register_intro`(`register_id`,`website_intro`) values (1,'开源中国 www.oschina.net 是目前中国最大的开源技术社区。我们传播开源的理念，推广开源项目，为 IT 开发者提供了一个发现、使用、并交流开源技术的平台。目前开源中国社区已收录超过两万款开源软件。'),(4,'月光博客，是一个专注于互联网、搜索引擎、社会化网络、IT技术、谷歌地图、软件应用等领域的原创IT科技博客，作者龙威廉（williamlong）。'),(5,'虎嗅网（http://www.huxiu.com）是一个用户可参与的商业资讯与观点交流平台。&lt;br /&gt;\r\n&lt;br /&gt;\r\n这个资讯及观点平台的核心，是关注互联网与移动互联网一系列明星公司（包括公众公司与创业型企业）的起落轨迹、产业潮汐的动力与趋势，以及互联网与移动互联网如何改造传统产业。&lt;br /&gt;\r\n&lt;br /&gt;\r\n我们致力于为用户创造获取与交流商业资讯的更&quot;有效率&quot;的体验 。&lt;br /&gt;'),(6,'苏宁易购是领先的综合网上购物商城, 在线特价销售家电、通讯数码、电脑、家居百货、服装服饰、母婴、图书、食品、保险、旅行、充值、团购等数万类商品和服务。正品行货, 全国联保, 本地配送, 货到付款。省钱放心上苏宁电器网上商城, 尽享购物乐趣！');

